import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Button,
} from "reactstrap";

export class menu extends Component {
  state = {
    collapsed: true,
  };
  render() {
    return (
      <div>
        <Navbar color="dark" lightgray expand="md">
          <NavbarBrand href="/"> Moncoiffeur</NavbarBrand>

          <NavbarToggler
            onClick={() => this.setState({ collapsed: !this.state.collapsed })}
            className="mr-2"
          />
          <Collapse isOpen={!this.state.collapsed} navbar>
            <Nav className="mr-auto" navbar>
              <NavItem>
                <NavLink href="/">Qui est nous ?</NavLink>
              </NavItem>
            </Nav>
            <Button outline color="info" className="mr-5">
              creer
            </Button>
            <Button outline color="info" className="mr-5">
              Connecter
            </Button>
          </Collapse>
        </Navbar>
        <img href="https://fr.freepik.com/photos/cheveux">
          Cheveux photo créé par freepik - fr.freepik.com
        </img>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(menu);
